import React, { Component } from 'react';
import cover from "../img/cover1.jpg";
import './home.css';
class Home extends Component {
    state = {  }
    render() { 
        return ( 
            <React.Fragment>
                <img src={cover} alt="" class="cover-img"/>
            </React.Fragment>
     );
    }
}
 
export default Home;
